import PackageJSON from '../../../package.json'

async function LogoutUser(setError) {
    const url = PackageJSON.API.BaseURL + PackageJSON.API.Logout;

    try {
        const response = await fetch(url, {
            method: 'GET',
            credentials: 'include',
        });

        if(response.status === 400 && response.json() && response.json().error)
            setError(response.json().error)
    
        if (!response.ok) return [];

        return true;
    }
    catch(e) {
        console.log(e);
        return [];
    }

}

export default LogoutUser;
